import React from 'react';
import '../App.css';

function About() {
    return (
      <div className="mainDiv">
        <div className="divContent" >
            <p className="customP">02. Talents</p>
            <h1>About me</h1>
            <div className="paragraph">
              <p> Always looking to improve my skills and acquire new ones. </p>
              <p>&#9733; Technology enthusiast.</p>  
              <p>&#9733; Lover of the Renaissance era and cactuses.</p>
              <p>&#9733; CSS favorite colors: <span className="deeppink">&#9724;</span>deeppink; <span className="lightsalmon">&#9724;</span> lightsalmon; 
              <span className="lightseagreen">&#9724;</span> lightseagreen</p>
              <p>&#9733; Current time zone: CEST/UTC+2</p>
            </div>
        </div>
        <div className="divContentRight">
        <h2>Technologies:</h2>
            <p><span className="customP"> React.JS  |  Javascript   |  HTML5  |  CSS3 | Firebase |  Photoshop | Figma</span></p>
            </div>
      </div>
    );
  }
  
  export default About;
